const styles = {
    container: {
      padding: '2rem',
      display: 'flex',
      justifyContent: 'center',
    },
    mainPaper: {
      position: 'relative', // Add relative positioning to the main Paper
      width: '50%',
      backgroundColor: '#325636',
      padding: '2rem', // Add padding to the main Paper
    },
    nestedPaper: {
      position: 'absolute', // Add absolute positioning to the nested Paper
      top: '50%', // Position the nested Paper at the center vertically
      left: '50%', // Position the nested Paper at the center horizontally
      transform: 'translate(-50%, -50%)', // Center the nested Paper
      padding: '1rem', // Add padding to the nested Paper
      backgroundColor: '#FFFFFF', // Adjust background color as needed
      zIndex: 1, // Ensure the nested Paper appears above the main Paper
    },
    title: {
      fontWeight: 'bold',
      color: '#FFFFFF',
    },
  };
  
  const PickupPage = () => {
    return (
      <div style={styles.container}>
        <Paper elevation={3} sx={styles.mainPaper}>
          <Typography variant='h5' sx={styles.title}>Store Details</Typography>
          <div style={styles.nestedPaper}>
            <StorefrontOutlinedIcon />
            <Typography variant='h6'>Relaxing Koala</Typography>
          </div>
        </Paper>
      </div>
    );
  };
  
  export default PickupPage;
